import React, { Fragment } from "react";
import SeriesCard from '../card/SeriesCard';
import 'swiper/swiper.less';
import Swiper from 'reat-id-swiper';


function NewSection(props) {
  const params = {
    slidesPerView: 3,
    spaceBetween: 30,
    slidesPerGroup: 3,
    loop: true,
    loopFillGroupWithBlank: true,
    pagination: {
      el: '.swiper-pagination',
      clickable: true
    },
    navigation: {
      nextEl: '.swiper-button-next',
      prevEl: '.swiper-button-prev'
    }
  }

  return (
    <Fragment>
      <Swiper {...params}>
        {[...Array(10).keys()].map(val=><SeriesCard/>)}
      </Swiper>
    </Fragment>
  );
}


export default NewSection;
